import React , {Fragment} from 'react'
import styles from './Modal.module.css'

const Backdrop = () => {
    return <div className={styles.backDrop}></div>
}

const Modal = () => {
  return (
    <Fragment>
      
      <div className={styles.overlay}></div>
    </Fragment>
  )
}

export default Modal
